import React from "react";
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
import Typewriter from 'typewriter-effect';


export default function LandingPage() {





    return (
        
            <section className = 'section-one'>
                <div className="text-center"  style = {{color:"#2C272E", fontFamily:'Poppins'}}>
                    <Row className = 'justify-content-center section-one-reverse w-100' >
                        <Col md={6} className='align-items-center align-self-center landing-page-text'>
                            <Typewriter
                            options={{
                                strings: ['Hi There!', 'My name is  Fahad Alaraik', 'I am a junior web developer'],
                                autoStart: true,
                                loop: true,
                                pauseFor:2500,  
                            }}
                            />    
                        </Col>
                        <Col md={3} className='align-items-center align-self-center'>
                            <img src= '../images/wave.gif' style = {{background:'transparent'}} width='276px' height='276px' />
                        </Col>
                    </Row>
                </div>
                
             

               


        </section>
       
        

    )




}
